const formation = [
     {
          "nom":"web development",
          "duree":"3 ans",
          "date de debut": "19/08/2021",
          "img":"src"
     },
     {
          "nom":"Cybersecurite",
          "duree":"1.5 ans",
          "date de debut": "19/12/2021"
     }
     
]


function FormationPage(){
	
	return (
		<div className="page formation">
               <h1>Nos formations</h1>
               <div className="grid formationGrid">
                    {
                         formation.map((formationItem)=>{
                              return(
                                   <div className="formationChild">
                                        <div className="formationImg" >

                                        </div>
                                        <div>
                                             {formationItem.nom}
                                        </div>

                                   </div>
                              )
                         })
                    }
               </div>
          </div>
	)
     
}

export default FormationPage
